INSERT INTO investment_firms (id, name, description, website, location, stages, sectors, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, firm_classification, enrichment_status) VALUES ('9a02c8aa-201a-453f-af86-a16119ec44df', 'IQ Capital', 'IQ Capital, we''re led by general partners Kerry Baldwin, Max Bautin, Simon Hirtzel, and Ed Stacey, who have collaborated for over 20 years investing in innovative Deep Tech companies. We focus on identifying companies with defensible intellectual property, breakthrough technologies, and global aspirations. Our team, rich in PhD expertise, has achieved over 20 successful exits to date, including acquisitions by industry giants like Oracle, Google, Apple, Facebook, Siemens, and various IPOs. From the Seed stage onward, we support founders in overcoming the challenges of building and scaling successful companies. Our team offers diverse perspectives rooted in deep science, technology, marketing, product-market fit, sales, talent acquisition, corporate finance, and M&A. Our investments typically range from £0.5m to £10m in disruptive Deep Tech companies across various sectors such as generative AI, advanced engineering, novel materials, space-tech, quantum hardware and algorithms, cyber and data security, and synthetic biology. Additionally, we leverage our extensive global connections to further support founders in their growth journey.. DeepTech focused. DeepTech deals: 40+. Fund size: $200M', 'https://iqcapital.vc/about-us/', 'UK', '["Pre-seed","Seed","Series A","Series B+"]'::jsonb, '["AI/ML","Biotech","Healthtech","Materials"]'::jsonb, '2025-12-25T17:44:48.987Z', 'com_b438fadc-b66f-40be-9528-7d913f7f3bba', 'grp_aa703c07-2212-4f88-b0ac-19d79adbbf2b', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_aa703c07-2212-4f88-b0ac-19d79adbbf2b","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_dbc35f0d-7ac7-4315-9d45-ec8a